(1, 1, 'NUSA DUA & TANJUNG  BENOA TEST PANJAAANG NUSA DUA & TANJUNG  BENOA TEST PANJAAANG', '<p>Nusa Dua offers a picture-perfect holiday experience. Its meticulously landscaped environment encompasses a tranquil resort enclave, providing a peaceful alternative to the intensity of some popular tourist zones on the island. Some of the most luxurious hotels on Bali are here, most with direct access to pristine white sand beaches and gentle clear blue waters. The 18-hole Nusa Dua Golf and Country Club is one of Balis top golf courses; the Pasifika Museum showcases the art of Bali, Southeast Asia, and the South Pacific region; and shopping options are abundant at the Bali Collection.</p>\n\n<p>Nusa Dua offers a picture-perfect holiday experience. Its meticulously landscaped environment encompasses a tranquil resort enclave, providing a peaceful alternative to the intensity of some popular tourist zones on the island. Some of the most luxurious hotels on Bali are here, most with direct access to pristine white sand beaches and gentle clear blue waters. The 18-hole Nusa Dua Golf and Country Club is one of Balis top golf courses; the Pasifika Museum showcases the art of Bali, Southeast Asia, and the South Pacific region; and shopping options are abundant at the Bali Collection.</p>\n\n<p>Nusa Dua offers a picture-perfect holiday experience. Its meticulously landscaped environment encompasses a tranquil resort enclave, providing a peaceful alternative to the intensity of some popular tourist zones on the island. Some of the most luxurious hotels on Bali are here, most with direct access to pristine white sand beaches and gentle clear blue waters. The 18-hole Nusa Dua Golf and Country Club is one of Balis top golf courses; the Pasifika Museum showcases the art of Bali, Southeast Asia, and the South Pacific region; and shopping options are abundant at the Bali Collection.</p>\n\n<p>Nusa Dua offers a picture-perfect holiday experience. Its meticulously landscaped environment e