(2, 1, 'bali, the land of  the gods', '<p>Lying to the east of Java and west of Lombok, the small (5,633 square kilometers in area) yet beautiful and fascinating island of Bali has long been ONE OF Indonesias most popular and well-known tourist destinationS, with an appeal that encompasses every taste and every budget, whether the visitor is seeking a physically active holiday, a time for pampering and relaxation, or an experience of cultural immersion.</p>\n', 1, '2013-02-20 18:37:25', 1, '2013-02-22 14:05:57', 1),
(3, 2, 'Bali OK ', '<p>Lying to the east of Java and west of Lombok, the small (5,633 square kilometers in area) yet beautiful and fascinating island of Bali has long been ONE OF Indonesias most popular and well-known tourist destinationS, with an appeal that encompasses every taste and every budget, whether the visitor is seeking a physically active holiday, a time for pampering and relaxation, or an experience of cultural immersion.</p>\n', 1, '2013-02-21 12:19:25', 1, '2013-02-26 17:58:02', 1),
